import React, { useState, useEffect } from 'react';
import {
  AppBar,
  Toolbar,
  Container,
  Typography,
  Button,
  Stack,
  Drawer,
  List,
  ListItem,
  ListItemButton,
  ListItemIcon,
  ListItemText,
  Box,
  IconButton,
} from '@mui/material';
import { Link, useNavigate } from 'react-router-dom';
import { useSelector, useDispatch } from 'react-redux';
import { logout } from '../features/actions';  
import MenuIcon from '@mui/icons-material/Menu';
import DashboardIcon from '@mui/icons-material/Dashboard';
import { useTheme } from '@mui/material/styles';
import useMediaQuery from '@mui/material/useMediaQuery';
import axios from '../features/axios';

const Navbar = () => {
  const dispatch = useDispatch();
  const user = useSelector((state) => state.user); 
  const navigate = useNavigate();
  const [isDrawerOpen, setIsDrawerOpen] = useState(false);
  const theme = useTheme();
  const isMobile = useMediaQuery(theme.breakpoints.down('sm'));

  useEffect(() => {
    console.log('User in useEffect:', user);
  }, [user]);

  const handleLogout = async () => {
    try {
      const response = await axios.post('/logout');  

      if (response.status === 200) {
        dispatch(logout());  
        navigate('/login');  
      } else {
        console.error('Logout failed:', response.data.message);
      }
    } catch (error) {
      console.error('Error during logout:', error);
    }
  };

  const toggleDrawer = (open) => (event) => {
    if (event.type === 'keydown' && (event.key === 'Tab' || event.key === 'Shift')) {
      return;
    }
    setIsDrawerOpen(open);
  };

  const dashboardLinks = (
    <>
      {user && user.role === 'citoyen' && (
        <Button component={Link} to="/dashboard" sx={linkStyle}>
          Dashboard
        </Button>
      )}
      {user && user.role === 'chef' && (
        <Button component={Link} to="/chef" sx={linkStyle}>
          Chef Dashboard
        </Button>
      )}
      {user && user.role === 'admin' && (
        <Button component={Link} to="/admin" sx={linkStyle}>
          Admin Dashboard
        </Button>
      )}
    </>
  );

  const getAuthButtons = () => {
    if (!user) {
      return (
        <>
          <Button component={Link} to="/" sx={linkStyle}>
            Accueil
          </Button>
          <Button component={Link} to="/login" sx={linkStyle}>
            Connexion
          </Button>
          <Button component={Link} to="/register" sx={linkStyle}>
            Inscription
          </Button>
        </>
      );
    } else {
      return (
        <Button variant="outlined" sx={logoutButtonStyle} onClick={handleLogout}>
          Déconnexion
        </Button>
      );
    }
  };

  const drawerList = (
    <Box sx={{ width: 250 }}>
      <List>
        {/* Dashboard links for mobile */}
        {dashboardLinks}
        <ListItem disablePadding>
          <ListItemButton onClick={handleLogout}>
            <ListItemIcon>
              <DashboardIcon />
            </ListItemIcon>
            <ListItemText primary="Déconnexion" />
          </ListItemButton>
        </ListItem>
      </List>
    </Box>
  );

  return (
    <AppBar
      position="static"
      sx={{ backgroundColor: '#232323', color: '#fff', py: 1, boxShadow: 2 }}
    >
      <Container maxWidth="lg">
        <Toolbar sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
          {isMobile && (
            <IconButton
              color="inherit"
              aria-label="open drawer"
              edge="start"
              onClick={toggleDrawer(true)}
              sx={{ mr: 2 }}
            >
              <MenuIcon />
            </IconButton>
          )}

          <Typography
            variant="h5"
            component="h2"
            fontFamily="'Roboto', sans-serif"
            fontWeight="500"
            component={Link}
            to="/"
            style={{ color: 'white', textDecoration: 'none' }}
          >
            Tribunal de Commerce à Casablanca
          </Typography>

          <Stack direction="row" spacing={2} alignItems="center">
            {user && dashboardLinks}
            {getAuthButtons()}
          </Stack>
        </Toolbar>
      </Container>

      <Drawer open={isDrawerOpen} onClose={toggleDrawer(false)}>
        {drawerList}
      </Drawer>
    </AppBar>
  );
};

const linkStyle = {
  textDecoration: 'none',
  color: '#fff',
  fontSize: '1rem',
  textTransform: 'none',
  '&:hover': {
    textDecoration: 'underline',
  },
};

const logoutButtonStyle = {
  color: '#fff',
  borderColor: '#fff',
  textTransform: 'none',
  '&:hover': {
    borderColor: '#ddd',
    backgroundColor: 'rgba(255, 255, 255, 0.1)',
  },
};

export default Navbar;
